import { Box, Heading, TabNav, Text } from '@primer/react';

export function CodeSnippet() {
  return (
    <Box
      sx={{
        border: '1px solid',
        borderColor: 'border.default',
        borderRadius: 2,
        alignSelf: 'flex-start',
        width: '100%',
        maxWidth: '600px',
        overflow: 'hidden',
      }}
    >
      <Box
        sx={{
          borderBottom: '1px solid',
          borderColor: 'border.default',
          p: 3,
        }}
      >
        Get label
      </Box>
      <Box
        sx={{
          pt: 2,
          px: 3,
        }}
      >
        <TabNav
          aria-label='Main'
          sx={{
            marginBottom: '-1px',
          }}
        >
          <TabNav.Link
            href='#'
            selected
            sx={{
              bg: 'transparent !important',
            }}
          >
            Home
          </TabNav.Link>
          <TabNav.Link href='#'>Documentation</TabNav.Link>
          <TabNav.Link href='#'>Support</TabNav.Link>
        </TabNav>
      </Box>
      <Box
        sx={{
          bg: 'canvas.subtle',
          borderTop: '1px solid',
          borderColor: 'border.default',
          p: 3,
          fontSize: 2,
        }}
      >
        <pre>
          <code>const code = 'try this';</code>
        </pre>
      </Box>
    </Box>
  );
}
